Маска с экстрактом зеленого чая:
- увлажняет и питает;
- тонизирует, стимулирует клеточный метаболизм;
- восстанавливает и заживляет повреждения;
- приостанавливает процессы увядания и омолаживает;
- выравнивает цвет лица
- усиливает природную защиту кожи;
- устраняет воспаление и раздражение;
- оберегает от бактерий и грибков.
Экстракт зелёного чая приостанавливает процессы увядания кожи, омолаживает, тонизирует, увлажняет, питает витаминами и микроэлементами, устраняет отёчность, воспаления и раздражение.
Способ использования: маску применяют после очищения и тонизирования кожи. Открыть саше и извлечь маску, аккуратно расправить, приложить к коже лица согласно отверстиям для глаз, носа и губ, разровнять и удалить пузыри воздуха. Время воздействия — 20–25 минут. После удаления маски остатки сыворотки вбить в кожу похлопывающими движениями, не смывать.

